import React from 'react';
import { StyledSearch } from './styles';

interface ISearchProps {
  className?: string;
}
const Search: React.FC<ISearchProps> = ({ className }) => {
  return (
    <StyledSearch action="/" method="get" className={className}>
      <label className='visually-hidden'>Поиск по сайту</label>
      <input type="search" name="page-search" value="Поиск по сайту" onChange={() => {}} />
      <button type="submit">Найти</button>
    </StyledSearch>
  )
};

export default Search;
